import math

def primefac(n): # Needs math
	d=2
	i=-1
	factors=[]
	indices=[]
	while(n>1):
		if(n%d==0):
			i+=1
			factors.append(d)
			indices.append(0)
		while(n%d==0):
			indices[i]+=1
			n//=d
		d+=1
		if(d>int(math.sqrt(n))):
			break
	if(n>1):
		factors.append(n)
		indices.append(1)
	return [factors,indices]

def nof(x):
	l=primefac(x)[1]
	p=1
	for i in l:
		p*=i+1
	return p

def firstone(l):
	if len(l)==0:
		return 0
	for i in range(0,len(l)):
		if l[i]==1:
			return i

def disp(l,c):
	f=firstone(l)
	print(l[:f],end=" + ")
	print("[1] *",len(l)-f,end=c)

def inc(x,y): # Increments a number array x with variable base array y # Needs nothing
	l=len(y)
	if(x[l-1]!=y[l-1]-1):
		x[l-1]+=1
		return x

	p=l-1
	while p>=0:
		if(x[p]!=y[p]-1):
			x[p]+=1
			for k in range(p+1,l):
				x[k]=0
			return x
		p-=1
	for i in range(0,l):
		x[i]=0
	return x

def power(a,b,m=None): # = product(a[i]**b[i]) # Needs Nothing
	if m==None:
		s=1
		for i in range(0,len(a)):
			s*=a[i]**b[i]
		return s

	s=1
	for i in range(0,len(a)):
		s*=(a[i]%m)**b[i]
		s%=m
	return s


prime=[]

def setprimes(n):
	life=open("./primes1.txt","r")
	x=0
	while True:
		x=int(((life.readline()).split(", "))[1])
		if x>n:
			return
		prime.append(x)
		

